Text:
@gitarreas: Det kunde juh vara en smart ide att bara ladda upp en torrent i taget istället för 6 om man har begränsad upladdningshastighet. Själv hara jag bara 2mbit upload men jag lyckas ändå ladda upp 50GB+ torrents på typ 3-4 dar. Dom här 6.5 GB är snart inne på 4e veckan.

Dessutom så kan det bli en hel del slöseri eftersom folk som laddat ner av dig inte orkar vänta och avbryter sin nedladdning. Och då måste du juh igen ladda upp det igen det som han inte hunnit/velat dela med sig.

/Kef71
